    ?artist2 <http://www.w3.org/2000/01/rdf-schema#label> ?commonArtist .
    ?artist3 <http://www.w3.org/2000/01/rdf-schema#label> ?commonArtist .

    # Subquery for artists associated with Watchtower
    {
        SELECT DISTINCT ?artist2 WHERE {
            ?artist1 <http://dbpedia.org/ontology/associatedMusicalArtist> ?artist2 .
            { 
                SELECT ?artist1 WHERE {
                    <http://dbpedia.org/resource/Watchtower_(band)> <http://dbpedia.org/ontology/associatedMusicalArtist> ?artist1 .
                }
            }
        }
    }

    # Subquery for artists associated with Red Tide (band)
